import React from "react"
import "../CSS/WarningMessage.css"

const WarningMessage = ({message}) => {
    return <figure className="WarningMessage"><figcaption>{message}</figcaption><i className="fas fa-exclamation-circle"></i></figure>
}

export default WarningMessage
